import React, { useState } from 'react';
import { Button } from '@mui/material';
import LocalMallIcon from '@mui/icons-material/LocalMall';
import Login from './Login';
import Signup from './SignUp';

function Header() {
    const [isLoginVisible, SetisLoginVisible] = useState(false);
    function Loginfun() {
        return (
            SetisLoginVisible(true)
        )
    }
    function SignUpfun() {
        return <Signup />
    }
    return (
        <div>
            <nav className="navbar navbar-expand-lg navbar-light bg-info">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#"><LocalMallIcon />  LazyBuyer</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                        </ul>
                        <div className="d-flex">
                            <button className="btn btn-primary" type="submit" style={{ marginRight: "10px" }} onClick={Loginfun} >Login</button>
                            {isLoginVisible ? <div> <div class="mb-3 row">
                                <label for="staticEmail" class="col-sm-2 col-form-label">Email</label>
                                <div class="col-sm-10">
                                    <input type="text" readonly class="form-control-plaintext" id="staticEmail" value="email@example.com" />
                                </div>
                            </div>
                                <div class="mb-3 row">
                                    <label for="inputPassword" class="col-sm-2 col-form-label">Password</label>
                                    <div class="col-sm-10">
                                        <input type="password" class="form-control" id="inputPassword" />
                                    </div>
                                </div></div> : null}

                            {/* <button onClick={SignUpfun} className="btn btn-primary" type="submit">Sign Up</button> */}
                        </div>
                    </div>
                </div>
            </nav>
        </div>
    )
}
export default Header;
